import React from 'react';
import Header from './Components/Header/Header';
import Footer from './Components/Footer/Footer';
import {Outlet} from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header></Header>
        <Outlet />
      <Footer></Footer>
    </div>
  );
}

export default App;
